    return (
        <div className="container-fluid">
            <div className="row">
                <div className="jumbotron col-10 offset-1">
                    <h1>Pirate Tic Tac Toe</h1>
                </div>
            </div>
            <AppProvider>
                <PirateTicTacToe/>
            </AppProvider>
        </div>
    );
}
